  return (
    <>
      <Helmet>
        <title> Map | Bid2Hire </title>
      </Helmet>

      <Container>
        <Typography variant="h4" sx={{ mb: 5 }}>
          Map
        </Typography>
      </Container>
    </>
  );
}
